class Solution:
    def makeTheIntegerZero(self, num1: int, num2: int) -> int:
        operations = 0
        while num1 != 0 and operations <= 60:
            i = 0
            while i <= 60:
                if num1 - (2**i + num2) == 0:
                    num1 = 0
                    operations += 1
                    break
                elif abs(num1 - (2**i + num2)) < abs(num1):
                    num1 -= (2**i + num2)
                    operations += 1
                    break
                i += 1
            if i > 60:
                return -1
        return operations if num1 == 0 else -1
